package com.pay.utils.factory.bean;import android.os.Parcel;import android.os.Parcelable;import android.text.TextUtils;import java.util.Map;public class AliPayResult implements Parcelable {	private String resultStatus;	private String result;	private String memo;	public AliPayResult(Map<String, String> rawResult) {		if (rawResult == null) {			return;		}		for (String key : rawResult.keySet()) {			if (TextUtils.equals(key, "resultStatus")) {				resultStatus = rawResult.get(key);			} else if (TextUtils.equals(key, "result")) {				result = rawResult.get(key);			} else if (TextUtils.equals(key, "memo")) {				memo = rawResult.get(key);			}		}	}	/**	 * @return the resultStatus	 */	public String getResultStatus() {		return resultStatus;	}	/**	 * @return the memo	 */	public String getMemo() {		return memo;	}	/**	 * @return the result	 */	public String getResult() {		return result;	}	@Override	public int describeContents() {		return 0;	}	@Override	public void writeToParcel(Parcel dest, int flags) {		dest.writeString(this.resultStatus);		dest.writeString(this.result);		dest.writeString(this.memo);	}	protected AliPayResult(Parcel in) {		this.resultStatus = in.readString();		this.result = in.readString();		this.memo = in.readString();	}	public static final Creator<AliPayResult> CREATOR = new Creator<AliPayResult>() {		@Override		public AliPayResult createFromParcel(Parcel source) {			return new AliPayResult(source);		}		@Override		public AliPayResult[] newArray(int size) {			return new AliPayResult[size];		}	};	@Override	public String toString() {		return "AliPayResult{" +				"resultStatus='" + resultStatus + '\'' +				", result='" + result + '\'' +				", memo='" + memo + '\'' +				'}';	}}